import React from "react";

import { Navigate} from "react-router-dom";

import "../Style/Home.css"
function Home() {
  return (
    <div>
      <div className="container">
        <div className="admin" onClick={<Navigate to="adm"/>}>Admin</div>
        <div className="student">Student</div>
      </div>
    </div>
  );
}

export default Home;
